import "../styles/App.css";
import {routes} from "../router"

const AppRouter = () => {
  return (
    <Routes>
            {routes.map(к => {

                    <Route key = {index} path = {route.path}>
                        element={<route.element />}
                    </Route>
            })}
            <Route path = "/*" element = {<Navigate to = "/posts" replace/>}/>
        </Routes>
        )
}

export default AppRouter
